Set in the Grand Canyon, a team of Smithsonian researchers have stumbled across a lost walled Aztec city guarded by some evil spirits, including a &quot;great flying serpent of death.&quot; As days turn to weeks, Susan Jordan, the daughter of the professor leading the expedition, assembles a team to rescue her father and his colleagues from the clutches of the ancient Aztec warriors and their horrible serpent god.            

